package main

import (
	"math"
	"fmt"
)

func maxProdOfThreeNums(nums []int) int {
	maxThree := []int{math.MinInt32, math.MinInt32, math.MinInt32}
	minTwo := []int{0,0}

	for i:=0;i<len(nums);i++ {
		if nums[i] < 0 {
			if nums[i] <= minTwo[0] {
				if minTwo[0] < minTwo[1] {
					minTwo[1] = minTwo[0]
				}
				minTwo[0] = nums[i]
			} else if nums[i] < minTwo[1] {
				minTwo[1] = nums[i]
			}
		}
		if nums[i] >= maxThree[0] {
			if maxThree[0] >= maxThree[1] && i >= 1 {
				if maxThree[1] >= maxThree[2] && i >= 2 {
					maxThree[2] = maxThree[1]
				}
				maxThree[1] = maxThree[0]
			}
			if nums[i] > maxThree[0] {
				maxThree[0] = nums[i]
			}
		} else if nums[i] >= maxThree[1] {
			if maxThree[1] >= maxThree[2] && i >= 2 {
				maxThree[2] = maxThree[1]
			}
			if nums[i] > maxThree[1] {
				maxThree[1] = nums[i]
			}
		} else if nums[i] >= maxThree[2] {
			maxThree[2] = nums[i]
		}
	}
	prodOfTwo := minTwo[0]*minTwo[1]
	if prodOfTwo < maxThree[1]*maxThree[2] {
		prodOfTwo = maxThree[1]*maxThree[2]
	}

	return int(prodOfTwo) * maxThree[0]
}

